import {
    IonBackButton,
    IonButtons,
    IonContent,
    IonFab,
    IonFabButton,
    IonHeader,
    IonIcon,
    IonMenuButton,
    IonPage,
    IonTitle,
    IonToolbar,
  } from "@ionic/react";
import { add } from "ionicons/icons";
import React from "react";
import Card from "../../components/Card/Card";

const Complexes: React.FC = () => {
    return(
        <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonButtons slot="start">
            <IonMenuButton />
          </IonButtons>
          <IonTitle>Complexes</IonTitle>
        </IonToolbar>
      </IonHeader>

      <IonContent fullscreen>
        <Card id="complexId" title="ComplexName" subtitle="Complex Name"/>
        <IonFab vertical="bottom" horizontal="end" slot="fixed">
          <IonFabButton>
            <IonIcon icon={add}/>
          </IonFabButton>
        </IonFab>
      </IonContent>
    </IonPage>
    );
};

export default Complexes;
